  const { name, email, onClickButton } = props;
const [popmenu,setPopmenu]=useState(false);

  return (
    <div>
      <p>{name}</p>
      <p>{email}</p>
      <button onClick={() => onClickButton()}>click</button>
    </div>
  );
};

export default Popup;
